import React from 'react'
import {Button} from 'react-bootstrap'

const PaginaCategorias = ({lista}) => {
    return (
        <>
            <h3>Teste</h3>
            <ul>
                <li>.</li>
                {lista.map(item => {
                    <li key={item.id}>
                        {item.descricao}
                        <Button variant="sucess">Remover</Button>
                    </li>
                })}
            </ul>
        </>
    )
}

export default PaginaCategorias
